import React from "react";

function HowToPlay() {
  return (
    <div className="howToPlay">
      <div class="container">
      <h1 class="font-weight-light">How To Play:</h1>
      <iframe src="https://docs.google.com/document/d/e/2PACX-1vRKV3acIaeO-nrlKP8sONu5RXFPfCkkDiY8EwVf05YhFMGuvNEvj44EOJ5OWRoSJdzEDWtR2ox4MfPc/pub?embedded=true"></iframe>
      </div>
    </div>
  );
}

export default HowToPlay;
